INSERT INTO general_bodies VALUES (22,'hats off!!! to all those hardwork gone behind this ADIPOLI site.\ni really feel that some people have taken lots and lots of efforts for this beauty of a site both in looks and functionalities.\nbut i think they may have missed one fine point ( my opinion) in making this site a total success........... and that is giving this site the publicity it should be getting.\ni mean that if unless all xmecians are not aware of this site.this site is not gonna be a full success.......\nso i feel , we have to do something collectively about this........',22),(24,'Azhar\nDo u have any suggestions to popularize the site ???\n\nRgds\nRobs',22),(25,'probably get everyone to update their profiles here........ i think that will help a lot... \nget somebody in each class responsible for getting all their classmates profile updated...',22),(26,'Good Idea, maybe you could get somebody in your batch/class to get all the profiles of your batch updated :-)\n\nIt currently stands at 82 updations out of 158 XMECians in Batch 98-02.',22),(27,'We had some coordinators for each batch (class actually for some of the batches.. who helped me collect member info a couple of years back. They were pretty helpful. \nI can trigger them to help get the profiles updated. But Robi, I think you guys used these lists to fill data in already ? Correct me if I am wrong.. I dont remember. Anyway I still have that little data, if useful and not outdated.\nThe importance of filling in data at xmec.net needs to be emphasized by way of examples, rather success stories.. (such as one I had sent across a while back, in xmec.)\nThe forums, etc. will be actively used only if there is some burning issue to be discussed. I came across this thread accidentally, to tell you the truth. \nWhoever comes here and bothers to check out the site, are most certainly impressed... but usage will remain low until there is some issue/discussion of interest.',22),(4,'Hi\r\n\r\nPlease register your comments, suggestions and complaints about the various aspects of the site. We can analyze them when we plan a later revision of the site....',4),(6,'\nnjan  innu collegil  poyirunnu..avide van  adi...innale night  2.10 someone\n(read  thakku) Royiye  kondu poyi  basketball courtil  ittu thalli...rathri\nthanne   ellarum   thakkune    thirichu   thalli..sirajine   muriyil    ittu\npootti....siraj backdooril  koodi chaadi  purathu vannu...then  binu sir and\nsiraj rathri motham hostelinu kaval irunnu...also innu ravile adi at college\nporch..me and jojo sttod watching side by side..both parties have registered\npolice complaint..police paranju \"ningal thalli theerakku..njangalkku varaan\nvayya..cinemaele  pole  njangal  avasanam  varaam\".  vali   vasu,chakkakkuru\nellarum  RSS   ine  kondu   vannittundu..innu  vaikittu   4.00pminanu  final\nshowdown..njan kanaan pokunnundu...(only kaanal..kanda thalleolikalkku vendi\nadi kondu mookkodinju mathiyayi)..ippo  kootta adi at college..abvp,rss  and\nsfi..also kalipp with kallooppara guys who have joined our college... now  3\nfinal year batches..6th sem,7th sem-kallooppara and 8th sem...adipoli...\n\nAnother yet another Version as follows\n\n\n\n oru puthiya adi prashanam. Thakkuvum  2nd year le kore aalukalum  chernnu Royye\n adichu.  njangalude  juniors adyamaayi  avar  aanungalanennu theliyichu.what  a\n unity!!. rathri 12.30 nanu sambhavam.  Appol thanne 3rd years ellavarum  irangi\n Anu Shankar, Dileep ranjith thudangiyavarumayi adi thudangi. pinne Siraj sirum,\n Binu Sirum chernnu othukki theerthu.\n\n Pitte divasam athayahu  28-08-02 ravile 3rd  years ellavarum thakkuvine  kaathu\n colleginu kaavalirunnu. avanum  Deepak AK yum  koodi collegil vannu.  JOJO yude\n roomilayirunnu kure  samayam.thirichu JOJOyude  escort odu  koodi avan  purathu\n kadannu. AK bike start chythu nilkunnu avan odi kayari sthalam vidan sramikkunu\n ,  mattavanmar  thadayunnu.  Avan  odi  Janani  vayana  salayil  kayari olichu.\n naattukar  vayana  salayil kayari  thallan  3rd years  ne  anuvadichilla. Pinne\n police vannu. ellavarodum choodayi. thakkuvine purathirakki, kaaryam  chodichu.\n 4  3rd  years  ne  stationlekku  kondu  pokaan  jeepil  kayatti.  appol   vaasu\n inspectorodu kaaryam detailed aayittu paranju. Thakkuvine nokki inptr  choodayi\n avaneyum avante oru friend oru jim kaaraneyum, pammaneyum kodu poyi. ellam  oru\n cinema katha pole alle. pinne kazhinja maasam SFI collegil samaram nadathi.\n\n college  Day  il thakku  prashanam  undakkiyathine thudarnnu  3rd  years police\n complainty koduthathinaanu Royye thalliyathu.',6),(7,'Are u like to call as an Engineer.\n\nTry to practice the X-MECians Proffessional language,\nUse always ENGLISH.\n\nYou can write any bullshit, but only in EnGLISH.',6),(8,'The site is amazing ...................\n\ngrowing fast .................',4),(10,'Do we need to stick to such a rule of English only ?\n\nIbrahim Kottu Parambil Ibrahim wrote:\n> \n> Are u like to call as an Engineer.\n> \n> Try to practice the X-MECians Proffessional language,\n> Use always ENGLISH.\n> \n> You can write any bullshit, but only in EnGLISH.',6),(11,'Hi all,\n\nSite is simply superb, making a site of this form requires lot of conviction..\n\ngreat work ..\n\nregs\nsamoj',4),(12,'  I also support Roby. Let members chooser whatever language they are comfortable with. This is the forum of MECians not \'SAYIPans\'. I dont know this Ibrahim personally, anyway this is my opinion on this.  \n  Cheers.',6),(14,'X-MECians Proffessional language Mallu aanu.\nI feel we should not stick to EnGLISH.\n\nIch schreibe auf deutsch auch.',6),(31,'any help needed from the 94-98 batch...\nwhat is the data status for this batch?\n\nSnehathode\nJBRobi Thomas wrote:\n> \n> Yes Vyas, \n> \n> There has been a rather exhaustive exercise to acquire the\n> Email IDs of all the XMECians . Of the approximately 1220\n> XMECians who have graduated from MEC, 1045 email IDs have\n> been recorded. However many of them may have expired or are\n> incorrect. I believe the xmec yahoo groups list is a subset\n> of the xmec.net database. What is the kind of help u are\n> expecting ?\n> \n> However only close to 476 XMECians have updated their\n> profiles in the last one and half years.\n> \n> Well the onus is on the people who actually benefitted from\n> the site to emphasize the same :-)',22),(17,'hi,\n\nToday is the first time i am accessing xmec.net... it is really good.. nice searching facilities... nicely planned site\n\ndeepa k.d.',4),(18,'1.	How to be more involved in improving the academic excellence of fellow MECians.\r\n\r\na.	Through XMEC web site : Alumni members should update their profiles with their field of technology and business domains mentioned and this is to be effectively brought across to the students in college. \r\nb.	The students of the college can seek help from these Xmecians for their project as well as for their seminar needs.\r\n\r\n\r\n\r\n\r\n2.	Tracking the Funds contributed towards Campus renovation.\r\n		\r\na.	Members expressed their general discontent over the passive response          of the authorities after receiving funds given toward building renovation and campus beautification.\r\nb.	It was decided to enquire further on the details of the expenditure of the contributed amount and to take a responsible stand on receiving a satisfactory response from the college authorities.\r\n\r\n\r\n\r\n3.	Steps to improve the recruitment scenario.\r\n \r\na.	The juniors and batch mates on the look out for jobs are to be helped in every possible way by each one. Members are to intimate the e-groups and the XMECian site about openings in their work arena.\r\nb.	A specific message board committed to publishing current job availabilities   could be included in the XMECian site.\r\n   \r\n\r\n\r\n\r\n\r\n    5. Chapter Meets.\r\n\r\na.	Decisions were taken on strong grounds to meet on a regular basis. The Annual meeting to be in March and the unofficial get-togethers to be held on every festive occasion; Vishu ,Onam and Christmas being a few to name. As the Executive committee is yet to be formulated the task of organizing the next meet was handed over to the members of batch 2001.\r\nb.	On a regular basis, the yearly activities are to commence with an Annual meeting (to be held in March) and to end with a Finale (year end meet in December).\r\n\r\n 6. Vision for the future. \r\n\r\na.	The Annual meeting should draw up a rough sketch of the year activities which are to be guided by a specific goal.\r\nb.	Financial planning to be done on a yearly basis and an audit to be done at year-end. \r\nc.	The Finale (last meeting of the calendar year) should include a session for the retrospection of the activities envisioned and those which were realized.\r\n\r\n\r\n\r\n7. The members expressed their inconveniences in accessing the XMEC site, which includes having to memorize quite hard to break passwords and unavailability of an option to retrieve forgotten passwords.',18),(21,'This seesm to be a good bulletin forum.....especiall with the threading\'s and all.....excellent work...simply amazing.',4),(28,'HI All\nMost colleges have Alumni meetings.. The rate at which these meetings happen in our college or used to happen in our college was annual (or so I think). But we have to admit that the importance of attending these meetings, tends to decline if they are so regular. \nSo perhaps we must have meetings every 5 years or something during a fixed date/week of the year ? This way, most xmecians may plan out in advance to try and make it for the meeting. The organizers (us/college), have ample time to make plans and get confirmations of attendance from fellow xmecians.\nMinutes (atleast if there are any formal decisions made) of any XMEC Meeting must be sent across to the whole group (perhaps as a special notice).\nHope to get some more suggestions/feelings on this post.\nSuggestion: During these meetings, let\'s not make it a formal, boring event. We are never too old to enjoy and have a swell time.\nRegards\nVyas',28),(29,'Yes Vyas, \n\nThere has been a rather exhaustive exercise to acquire the Email IDs of all the XMECians . Of the approximately 1220 XMECians who have graduated from MEC, 1045 email IDs have been recorded. However many of them may have expired or are incorrect. I believe the xmec yahoo groups list is a subset of the xmec.net database. What is the kind of help u are expecting ?\n\nHowever only close to 476 XMECians have updated their profiles in the last one and half years. \n\nWell the onus is on the people who actually benefitted from the site to emphasize the same :-)',22),(30,'Yes, it is a good idea to decide on the date well ahead of time, so that all can plan accordingly... but a meeting once in 5 years is a little too much. Once in two years is a good idea !!!',28),(32,'I agree with Robi here. Meeting ever yr will lose its importance, yet once in 5yrs is a bit too much (at least for bachelors - LOL). 2 or 3 yrs is more like it. I also suggest that a poll be conducted to fix the date so as to meet the convinience of the majority. If thats the case lemme take the honors to cast the 1st vote in favor of 29th Feb.',28),(33,'Dunno if i make any sense - but it shudnt be utterly non-sense.\n\nWe have 5 categories here:\n1. Xmecians - who have not at all heard abt this site\n2. Xmecians - who have heard but dont know how to proceed\n3. Xmecians - who have heard,know how to proceed, but dont want to\n4. Xmecians - who have heard, know how to proceed, but lazy to do so\n5. Xmecians - who r already registered members, but site visiting freq is very minimal and hence inactive\n\nSome improbable solutions to each of those categories:\n1. Word of Mouth. Assign Batch Reps, Class Reps. Announce @ Alumni Meets, Xmec email Grps etc...\n2. Guide them to Moderators using above media or make a provision in the website - wherein if an Xmec-ian logs in for the first time, his random password is emailed to him along with the procedure. \n3. F.O\n4. Allocate some active members to help them filling it out. In case any one feels that I have may have shown a bias to this category; kindly note that its purely non-coincidental but on purpose.\n5. Make www.xmec.net your home page. Active members ensure that we have a hot topic being discussed every week, so that when members log-in they have to just reply. We need more creative active members. If this is approved, then lemme suggest a topic for the upcoming week.\n\" One plus One Two is Maths; One plus One One is Love\"',22),(35,'Hi Joby\n\nThe total number of XMECians of Batch 6 (1994-98) is 57. The total number of XMECians in the Batch 6 is 115. Any help by anybody to improve this statistics in appreciated. Please contact us if you need any further details\n\nRgds\nXMEC Webmasters',22),(36,'PASTING MAIL TO XMEC FOR REFERENCE.\n\nHi All\nThere is a discussion that was triggered in http://www.xmec.net, which says:\n\"HI All\nMost colleges have Alumni meetings.. The rate at which these meetings happen in our college or used to happen in our college was annual (or so I think). But we have to admit that the importance of attending these meetings, tends to decline if they are so regular. \nSo perhaps we must have meetings every 5 years or something during a fixed date/week of the year ? This way, most xmecians may plan out in advance to try and make it for the meeting. The organizers (us/college), have ample time to make plans and get confirmations of attendance from fellow xmecians.\nMinutes (atleast if there are any formal decisions made) of any XMEC Meeting must be sent across to the whole group (perhaps as a special notice).\nHope to get some more suggestions/feelings on this post.\nSuggestion: During these meetings, let\'s not make it a formal, boring event. We are never too old to enjoy and have a swell time.\nRegards\nVyas\"\nSo as not to clog up mailboxes, we can have this and similar discussions in the xmec.net site. (After logging in, goto Members --- Bulletin -- General Discussions to find these discussion).\nSome feel that 5 years is too much, but for some coming for such an occasion, may not be easy.. To maximize attendance should be the objective. In 2004, MEC would have existed for 15 years. Sounds like a nice time to start and enough time for all to plan. Maybe a convenient period such as December or something. So for the spirit of mec, let\'s do it !!\nRegards\nVyas\nCE93-97',28),(37,'oo pinne...\n\n Thoppiya ..',6),(39,'hi all,\n\nalumni meet is a great idea.. can we club it with some official holidays so that we can get more people to attend it..\n\nregs\nsamoj',28),(40,'Hi,\n\nI agree with the general opinion that 5 yrs is 2 much...U\'ll have to reintroduce urself to all at every meeting, then....So, better go for 2 yrs...that sounds like a reasonable one...Fixing the date and time in advance is a good option...all can plan accordingly....But the point is, each one of us should feel that MEC was part of our lives for 4 yrs and there\'s much more we can do for ourselves, other MECians and MEC itself...No chance of improving attendance, otherwise....',28),(41,'yes,\nthis site should be publicised much more...',22),(42,'Yo !!\n\nPlease make this site accessible through all(most) browsers (IE and Netscape, all versions atleast). I am not able to access the popup menu with netscape.\n\nI use solaris, but i think it shouldnt matter, because the menu works fine on netscape 4.7, but not in mozilla 1.4 (netscape 7.x , i think), and netscape 4.7 is obsolete.\n\nRegards,\nKrishnan\nEE 13/96',4),(43,'Thanks for notifying the problem. We have received a number complaints that the current site is not compatible with many browsers. We plan to  address many of these issues in a later version of the site. Please bear with us in the meantime. Please let us know of other bottlenecks that you face while using this xmec.net site.\n\nRgds\n\nXMEC Webmasters',4);
