INSERT INTO technical_bodies VALUES (2,'Bonjour,\n Seems that many whizkids and wizards break their shell in our mec incubator. What about a kid standing back and asking his/her parents, did u do the right thing!. This idea is not original. G.H.Hardy, the mentor of Ramanujan, asked the same about mathematics and mathematicians in his classis book, A Mathematician\'s Apology. We may not get too many people  hitting here for such a boring discussion. Still it may be worth thinking after such a long break from one\'s studies.\n  \n1) Did we learn the right thing?.\n   \n2) Did we get the right mentors?.\n\n3) We ended up being the one\'s in our own plans?.\n\n4) What would have made things better?.\n\nThere will be something here for everyone to learn if we get a few sincere answers. Otherwise, my apologies for spoiling a technical forum with a bunch of trivialities.\n\nciao\nSibiRaj \nEE-93/97',2);
