#
# Table structure for table 'xmec_address'
#

DROP TABLE IF EXISTS xmec_address;
CREATE TABLE xmec_address (
  user_id varchar(25) binary NOT NULL default '',
  type enum('PRESENT','COMPANY','PERMANENT') NOT NULL default 'PRESENT',
  house_name varchar(50) binary NOT NULL default '',
  street varchar(50) binary NOT NULL default '',
  area varchar(50) binary NOT NULL default '',
  city varchar(50) binary NOT NULL default '',
  state varchar(50) binary NOT NULL default '',
  country varchar(50) binary NOT NULL default '',
  postal_code varchar(15) binary NOT NULL default '',
  telephone_no varchar(50) binary NOT NULL default '',
  visibility enum('PUBLIC','XMEC','PRIVATE') NOT NULL default 'PUBLIC',
  PRIMARY KEY  (user_id,type),
  KEY street (street),
  KEY area (area),
  KEY city (city)
) TYPE=MyISAM;

