DROP TABLE IF EXISTS xmec_user;
CREATE TABLE xmec_user (
  id varchar(25) binary NOT NULL default '',
  alias varchar(25) binary NOT NULL default '',
  first_name varchar(255) binary NOT NULL default '',
  middle_name varchar(255) binary NOT NULL default '',
  last_name varchar(255) binary NOT NULL default '',
  nick_name varchar(255) binary NOT NULL default '',
  sex enum('M','F') NOT NULL default 'M',
  marital_status enum('M','S') NOT NULL default 'S',
  date_of_birth date NOT NULL default '0000-00-00',
  branch char(2) NOT NULL default 'EE',
  company varchar(255) binary NOT NULL default '',
  official_email varchar(255) binary NOT NULL default '',
  personal_email varchar(255) binary NOT NULL default '',
  forwarding_email varchar(255) binary NOT NULL default '',
  chapter_id varchar(25) binary NOT NULL default '',
  mobile_no varchar(25) NOT NULL default '',
  work_type varchar(255) NOT NULL default '',
  webpage varchar(200) NOT NULL default '',
  icq varchar(50) NOT NULL default '',
  aol varchar(50) NOT NULL default '',
  yahoo varchar(50) NOT NULL default '',
  msn varchar(50) NOT NULL default '',
  jabber varchar(50) NOT NULL default '',
  preferences int(4) unsigned NOT NULL default '0',
  last_update datetime NOT NULL default '0000-00-00 00:00:00',
  PRIMARY KEY  (id),
  UNIQUE KEY alias (alias),
  KEY alias_2 (alias),
  KEY first_name (first_name),
  KEY company (company),
  KEY work_type (work_type)
) TYPE=MyISAM;

